import React from "react";
import Dropdown from "./Dropdown";

const ProductsButton = () => {
  const dropdownItems = [
    {
      label: "Tools",
      submenu: [
        { label: "Shovels" },
        { label: "Axes" },
        { label: "Hammers" },
        { label: "Screwdrivers" },
      ],
    },
    {
      label: "Electric tools",
      submenu: [
        { label: "Lawn mowers" },
        { label: "Chainsaws" },
        { label: "Leaf blowers" },
        { label: "Drills" },
      ],
    },
    {
      label: "Plants & seeds",
      submenu: [
        { label: "Flowers" },
        { label: "Saplings" },
        {
          label: "Seeds",
          submenu: [
            { label: "Vegetable seeds" },
            { label: "Fruit seeds" },
            { label: "Flower seeds" },
          ],
        },
      ],
    },
    { label: "Flower pots" },
    { label: "Garden decorations" },
    { label: "Pools & accessories" },
  ];

  return (
    <div className="App">
      <Dropdown items={dropdownItems} />
    </div>
  );
};

export default ProductsButton;
